全品！送料無料キャンペーン実施中！<br>(※一部地域除く詳しくはご利用ガイドをご覧ください)世界のハンドツールをリードする、APEX GROUP (アペックスグループ)のハンドツールブランドSATA(サタ)日本初上陸のXLX-BEAM?コンビネーションレンチ10本セットになります。SATAの優れた機能が搭載され非常に使いやすい設計になっています。SATA独自のXLX-BEAM?システムはヘッド部が90度になるように設計され従来よりも525％強い締付けが容易に出来るようになっております。今までにない新しい機能が搭載されたコンビネーションレンチになります。ハンドツールの使いやすさを追求した商品です。サイズは8.10.12.13.14.15.16.17.18.19mmの10本セットになっています。(ハンドツールプロ仕様）<img src="http://image.rakuten.co.jp/suncardo/cabinet/sign-banner/700x150-20.jpg" border="0">
